import React from 'react';
import logo from './logo.svg';
import './App.css';
import Search from './search';
import Add from './add';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      listUser: []
    }
  }
  render() {
    return (
      <div className="App">
        <Search list={this.listUser}></Search>
        <Add></Add>
      </div>
    )
  }
}

export default App;
